"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vitamin supplements (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H10874637\">",
"      <span class=\"h1\">",
"       What are vitamins?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vitamins are substances found in food. Most vitamins are substances the body can&rsquo;t make on its own but that it needs to work well.",
"     </p>",
"     <p>",
"      Vitamin supplements are pills, capsules, or liquids that have vitamins in them. Supplements are another way (besides food) that people can get vitamins.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10874652\">",
"      <span class=\"h1\">",
"       Should I take vitamin supplements?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You probably do not need to take vitamin supplements. But it probably won&rsquo;t hurt to take a multivitamin or small doses of individual vitamins.",
"     </p>",
"     <p>",
"      Experts recommend that most adults get their vitamins from food rather than from supplements. That&rsquo;s because eating vitamin-rich foods has other benefits besides getting you the vitamins you need. Still, there are some cases in which vitamin supplements can be helpful. For example, women who are pregnant or planning to get pregnant soon should take certain supplements. This is discussed in more detail below. There are also some groups who might benefit from vitamin supplements. These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Adults age 65 and older",
"        </strong>",
"        &ndash; Older adults might benefit from taking 600 to 800 units of vitamin D a day. This might help strengthen bones and prevent falls.",
"       </li>",
"       <li>",
"        <strong>",
"         People with vitamin deficiencies",
"        </strong>",
"        &ndash; A vitamin deficiency is when a person does not have enough of a particular vitamin for good health. People with vitamin deficiencies sometimes need supplements. If you have a vitamin deficiency, your doctor will tell you which supplements to take and at what dose. You might even need to get vitamin shots.",
"       </li>",
"       <li>",
"        <strong>",
"         People who have had weight loss surgery",
"        </strong>",
"        &ndash; People who have had weight loss surgery often can&rsquo;t get all the vitamins they need from food. If you have had weight loss surgery, ask your doctor if you need supplements. He or she can tell you which ones are best for you.",
"       </li>",
"       <li>",
"        <strong>",
"         People who do not eat any animal products (called &ldquo;vegans&rdquo;)",
"        </strong>",
"        &ndash; People who do not eat meat, eggs, milk, or other foods that come from animals sometimes need supplements. If you follow a vegan diet, ask your doctor or nurse if you should take any supplements.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10874667\">",
"      <span class=\"h1\">",
"       Are there any vitamin supplements I should not take?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Here are some vitamins supplements that can cause problems:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Vitamin A &ndash; In places where people have good access to healthy food, such as the United States and Europe, doctors recommend against taking vitamin A supplements. That&rsquo;s because vitamin A supplements might increase the risk of cancer, heart disease, and bone fractures. In pregnant women, taking too much vitamin A can harm the baby.",
"       </li>",
"       <li>",
"        Vitamin E &ndash; Doctors recommend against taking vitamin E supplements. Studies suggest that vitamin E supplements might increase the risk of dying.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10874682\">",
"      <span class=\"h1\">",
"       What&rsquo;s the best way to get the vitamins I need from food?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The best way is to eat a diet that includes a lot of fruits, vegetables, and whole grains, and not a lot of meats or fatty foods. Some vitamins are found only in animal sources, such as meat or eggs. But overall, fruits and vegetables have the highest concentrations of vitamins. Fruits and vegetables also have lots of fiber and other ingredients that promote good health.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H10874699\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to get pregnant, take a &ldquo;prenatal&rdquo; multivitamin every day that has at least 400 micrograms of",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?24/57/25492?source=see_link\">",
"       folic acid",
"      </a>",
"      (one of the B vitamins). This helps prevent some birth defects. Start taking the multivitamin at least a month before you start trying to get pregnant. It&rsquo;s not enough to start taking vitamins when you find out you are pregnant. At that point, your baby has already formed many body parts that rely on folic acid and other vitamins to develop normally.",
"     </p>",
"     <p>",
"      It is important not to take too much of any vitamin during pregnancy, especially vitamin A. Show your doctor or nurse the vitamins you plan to take to make sure the doses are safe for you and your baby.",
"     </p>",
