"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     The hook of the hamate is&nbsp;easily fractured and should be evaluated in patients with volar wrist pain, particularly in the area of the hypothenar eminence. It is palpated by placing the interphalangeal joint of the examiner's thumb over the pisiform and rolling the thumb toward the space between the index and middle fingers.",
