var title_f39_38_40555="Drugs causing dyspareunia";
var content_f39_38_40555=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F67305&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F67305&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medications or other treatments that are associated with dyspareunia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Tamoxifen - in premenopausal women can&nbsp;have anti-estrogenic&nbsp;effect, causing vaginal dryness, pain&nbsp;with penetration, and issues with arousal; can have estrogenic effect in postmenopausal women, potentially resulting in Candidiasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Aromatase inhibitors - anti-estrogenic effect may cause vaginal dryness, pain with penetration, and issues with arousal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chemotherapeutic agents - mechanism is unclear, possibly mucosal irritant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bromocriptine - may result in loss of libido or may be associated with painful clitoral tumescence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Immunosuppressants - may result in recurrent Candidiasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antidepressants -&nbsp;may result in&nbsp;loss of libido, issues with arousal or orgasm; anticholinergic medications may result in vaginal dryness&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antihistamines - may result in vaginal dryness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anticholinergics - may result in vaginal dryness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antibiotics - may result in Candidiasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antihypertensives - may result in loss of libido or issues with arousal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Estrogen-progestin contraceptives",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Depot medroxyprogesterone acetate -&nbsp;may result in&nbsp;vaginal dryness or&nbsp;issues with arousal&nbsp;&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spermicides - may result in contact irritation or allergy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Douches - may result in contact irritation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
